import React, { Component } from "react";
import jsPDF from "jspdf";
import { PureComponent } from "react";

export default class Result extends PureComponent {
  
  // var htmlContent = require('./samplePDF');

  constructor(props) {
    super(props);
    this.state = {};
  }

  jsPDFGenerator = () => {
    var doc = new jsPDF("p", "pt");
    doc.text = (20, 20, "This is my new PDF file!");
    doc.addPage();
    doc.text = (20, 20, "This is the second page of my new PDF file!");
    doc.save("generatedPDF.pdf");
  };

  render() {
    return <button onClick={this.jsPDFGenerator}>Generate PDF</button>;
  }
}
